org 0x7e00
jmp 0x0000:start

getchar:
	mov ah, 0x00
	int 16h
	ret

delchar:
	mov al, 0x08
	call putchar
	mov al, ' '
	call putchar
	mov al, 0x08
	call putchar
	ret

putchar: 	; o char tem que estar em al
	mov ah, 0x0e
	int 10h
	ret

reverse:	; a string tem que estar em si
	mov di, si
	xor cx, cx	; zerar contador
	.loop1:
	lodsb
		cmp al, 0
		je .endloop1
		inc cl
		push ax
		jmp .loop1
	.endloop1:

	.loop2:
		cmp cl, 0
		je .endloop2
		dec cl
		pop ax
		stosb
		jmp .loop2
	.endloop2:
	ret

tostring:	;ax tem que ter o inteiro e di a string
	push di
	.loop1:
		cmp ax, 0
		je .endloop1
		xor dx, dx
		mov bx, 10
		div bx	; ax = 999, dx = 9
		xchg ax, dx	; swap ax, dx
		add ax, 48	; 9 + '0' = '9'
		stosb
		xchg ax, dx
		jmp .loop1
	.endloop1:
	pop si
	cmp si, di
	jne .done
	mov al, 48
	stosb
	.done:
		mov al, 0
		stosb
		call reverse
	ret

gets:	;a string tem que estar em di
	xor cx, cx
	.loop1:
		call getchar
		cmp al, 0x08
		je .backspace
		cmp al, 0x0d
		je .done
		cmp cl, 10	;foi comparado com 10 pq foi o tamanho definido antes
		je .loop1
		stosb
		inc cl
		call putchar
		jmp .loop1
		.backspace:
			cmp cl, 0
			je .loop1
			dec di
			dec cl
			mov byte[di], 0
			call delchar
		jmp .loop1
	.done:
	mov al, 0
	stosb
	call endl
	ret


stoi:	;a string tem que estar em si
	xor cx, cx
	xor ax, ax
	.loop1:
		push ax
		lodsb
		mov cl, al
		pop ax
		cmp cl, 0
		je .endloop1
		sub cl, 48
		mov bx, 10
		mul bx
		add ax, cx
		jmp .loop1
	.endloop1:
	ret

initVideo:
	mov al, 13h
	mov ah, 0
	int 10h
	ret

writePixel:
	mov ah, 0ch
	int 10h
	ret

delay:
	mov bp, 20000
	.loop1:
		mov si, 20000
		.loop2:
			dec si
			cmp si, 0
			jnz .loop2
		dec bp
		cmp bp, 0
		jnz .loop1
	ret

prints:
	.loop:
		lodsb
		cmp al, 0
		je .endloop
		call putchar
		jmp .loop
	.endloop:
	ret

endl:
	mov al, 10
	call putchar
	mov al, 13
	call putchar
	ret

rectangle1:
	mov al, 8
	mov dx, 150
	.for1:
		cmp dx, 159
		je .endfor1
		mov cx, 55
		.for2:
			cmp cx, 257
			je .endfor2
			call writePixel
			inc cx
			jmp .for2
		.endfor2:
		inc dx
		jmp .for1
	.endfor1:
	ret

rectangle2:
