rectangle3:
	mov al, 3
	mov dx, 151
	mov bx, 86
	
	.loop1:
		cmp bx, 260
		jge .endloop1
		push bx
		mov bx, 0
		call delay
		pop bx
		.for1:
			cmp dx, 158
			je .endfor1
			mov cx, 56
			.for2:
				cmp cx, bx
				je .endfor2
				call writePixel
				inc cx
				jmp .for2
			.endfor2:
			inc dx
			jmp .for1
		.endfor1:
		mov cx, 30
		add bx, cx
		mov dx, 151
		jmp .loop1
	.endloop1:
	ret

drawImg: ; mov si, img
	mov dx, 37             ; Y
	.for1: 
		cmp dl, 109
		je .endfor1
		mov cx, 122        ; X
		.for2:
